import java.util.ArrayList;

class Club
    {
        private String name;
        private ArrayList<Player> players;

        public void setCName(String name)
        {
            this.name = name;
        }

        public String getCName()
        {
            return this.name;
        }

        public void addPlayer(Player p)
        {
            if(this.players==null)
            {
              this.players = new ArrayList<Player>(); 
              this.players.add(p);
            }
            else
            {
                this.players.add(p);
            }

        }

        public String printClubPlayers()
        {
            String rstring="";
            if(this.players==null || this.players.isEmpty())
                return "No Players play for "+this.getCName();
            else
            {
                if(this.players.size()==1)
                    return players.get(0).getPName() +" plays for "+this.getCName();
                else
                {
                    int count=0;
                    for (Player p : players) 
                    { 
                        if(count==0)
                            rstring=p.getPName();
                        else
                            rstring=rstring+","+p.getPName();
                        count++;
                    }
                    return rstring+" play for "+this.getCName();
                }   
            }
        }
    }

